const NewPost = () => {
  return (
    <div>
      <h4>Create New Post</h4>
      <form>
        <span>Title</span><input type="text" />
        <br />
        <textarea cols="30" rows="10"></textarea>
      </form>
    </div>
  )
}

export default NewPost
